import React from "react";

import Navbar from "../../components/navbar";
import Body from "../../components/body";
import SocialLinks from "../../components/socialLinks";
import Ovazi from "../../assets/ovazi";

import { Grid, Typography, List, ListItem } from "@material-ui/core";

import withStyles from "./styles";

class Experience extends React.Component {
  renderSocialLinks = () => {
    const { classes } = this.props;
    return (
      <div className={classes.socialLinkContainer}>
        <SocialLinks />
      </div>
    );
  };

  render() {
    const { classes } = this.props;
    return (
      <div>
        <Navbar />
        <Body>
          {this.renderSocialLinks()}
          <Grid container justify="center" alignContent="center">
            <div className={classes.container}>
              <Typography variant="h5" inline={true} className={classes.number}>
                02.
              </Typography>
              <Typography
                variant="h4"
                inline={true}
                className={classes.pageTitle}
              >
                Experience
              </Typography>
              <Grid container>
                <Grid item xs={2}>
                  <List>
                    <ListItem>
                      <Typography>Eleven Fifty Academy</Typography>
                    </ListItem>
                    <ListItem>
                      <Typography>Torchlite</Typography>
                    </ListItem>
                    <ListItem>
                      <Typography>Ovazi</Typography>
                    </ListItem>
                  </List>
                </Grid>
                <Grid item xs={10}>
                  stuff
                </Grid>
              </Grid>
              <Grid container />
            </div>
          </Grid>
        </Body>
      </div>
    );
  }
}

export default withStyles(Experience);
